import React from 'react';
import './video.scss';
import Poster from '../../Assets/Images/video-list-0.jpg'

const Video = () => {
    return (
        <section className = 'video'>
            <div className = 'video__videoplayer'>
                <video class = 'video__videocontent' controls poster={Poster}>
                </video>
            </div>
            <div className = 'video__description'>
                <div className = 'video__top'>
                    <h1 className = 'video__title'>BMX Rampage: 2018 Highlights</h1>
                    <div className = 'video__details'>
                        <h2 className = 'video__author'>By Red Cow</h2>
                    </div>
                </div>
            </div>
            {/* <Logo className = 'header__logo'/>
            <form className = 'header__form'>
                <input className = 'header__input' type='text' placeholder='Search'/>
                <div className = 'header__box'>
                    <input className = 'header__search' type='submit' value='+ UPLOAD'/>
                    <img className = 'header__usericon' src={userIcon}/>
                </div>
            </form> */}
        </section>
    );
}

export default Video;
